package com.example.networking.model.network.Picasso;

import android.content.Context;

import com.example.networking.model.localStorage.LocalStorage;
import com.squareup.picasso.Picasso;

public class ImageDownloader {
    public static void LoadImage(Context context, int userId) {
        Picasso.get().load("data:image/png;base64,")
                .into(LocalStorage.ImageSavePicasso(context, userId));
    }
}

